        def wrap_cb(original_cb):
            def cb(_t, _dsc, _fill_dsc, _fill_area):
                t = draw_task.__new__(draw_task)
                t._pointer = _t
                dsc = draw_glyph_dsc.__new__(draw_glyph_dsc)
